import AllInfo from "../components/AllInfo";
import {useEffect, useState} from 'react'
import axios from 'axios'

const Main = () => {
    const [creatures, setCreatures] = useState();
    const [loaded, setLoaded] = useState(false);

    useEffect(()=>{
        axios.get('https://botw-compendium.herokuapp.com/api/v2/all')
            .then(res => {
                setCreatures(res.data.data.creatures)
                setLoaded(true);
                console.log(res.data.data.creatures.food)
            })
            .catch(err=>console.error(err))
    })

    return(
        <div>
            {creatures.food.map((item, i) => {
                return <div key={i}>
                    <p>{item.name}</p>
                    <p>{item.cooking_effect}</p>
                    </div>
                })}
        </div>
    )
}

export default Main;
